export function getUsername(walletAddress: string) {
  if (walletAddress === "") return;
  interface requestOptionsI {
    method: string;
    redirect: RequestRedirect;
  }

  var requestOptions: requestOptionsI = {
    method: "GET",
    redirect: "follow",
  };

  fetch("http://localhost:8080/getuser/" + walletAddress, requestOptions)
    .then((response) => response.json())
    .then((result) => {
      if (!result.username) {
        return result;
      }
      return result;
    })
    .catch((error) => console.log("error", error));
}

